INSERT INTO `eoj_submissions` VALUES ('1119', '1006', '1000', '3', '2019-04-27 22:39:46', '2019-04-27 22:39:49', '276', '17460', 'AC', '100', 'Compile Successfully.\n\n- Test Point #0: Accepted, Time = 276 ms, Memory = 17460 KB, Score = 100\n\nAccepted, Time = 276 ms, Memory = 17460 KB, Score = 100\n', 'import java.util.*;\npublic class Main {\n	static int n;\n	static int m;\n	static int[][] array= new int[510][510];\n	static int[][] markarray= new int[510][510];\n	static int[][] dir4 ={{-1,0},{1,0},{0,-1},{0,1}};\n	static Queue<node> que = new LinkedList<node>();\n	static void dp(){\n		while(que.size()>0)\n		{\n			node t = que.poll();\n			\n			for(int i = 0;i < 4;i ++)\n			{\n				int dx = t.x + dir4[i][0];\n				int dy = t.y + dir4[i][1];\n				\n				if(dx < 0 || dy < 0 || dx > n-1 || dy > m-1 || markarray[dx][dy]>0) \n					continue;				\n				markarray[dx][dy] = t.step + 1;\n				que.offer(new node(dx,dy,t.step + 1));\n			}\n		}\n	}\n	public static void main(String args[]) {\n		Scanner in = new Scanner(System.in);\n	    n=in.nextInt();\n	    m=in.nextInt();\n	    for(int i=0;i<n;i++){\n	        for(int j=0;j<m;j++)\n	        {\n	            int tmp=in.nextInt();\n	            if(tmp==0){\n	                array[i][j]=0;\n	            }else{\n	            	que.offer(new node(i,j,0));\n	            	markarray[i][j]=99999999;\n	                array[i][j]=1;\n	            }\n	        }\n	    }\n        dp();\n	       for(int i=0;i<n;i++){\n	        for(int j=0;j<m;j++)\n	        {\n	        	if(markarray[i][j]!=99999999) {\n	        		System.out.print(markarray[i][j]);\n	        	}else {\n	        		System.out.print(0);\n	        	}\n	         if(j!=m-1)\n	        	 System.out.print(\" \");\n	        }\n	        System.out.println();\n	    }\n	}\n}\nclass node{\n	int x;\n	int y;\n	int step;\n	public node(int x, int y, int step) {\n		this.x = x;\n		this.y = y;\n		this.step = step;\n	}\n}');
