this.step = step;\n	}\n}');
INSERT INTO `eoj_submissions` VALUES ('1153', '1006', '1000', '3', '2019-04-30 15:01:28', '2019-04-30 15:01:31', '687', '56556', 'AC', '100', 'Compile Successfully.\n\n- Test Point #0: Accepted, Time = 264 ms, Memory = 13568 KB, Score = 50\n- Test Point #1: Accepted, Time = 423 ms, Memory = 56556 KB, Score = 50\n\nAccepted, Time = 687 ms, Memory = 56556 KB, Score = 100\n', 'import java.io.BufferedReader;\nimport java.io.IOException;\nimport java.io.InputStreamReader;\nimport java.io.OutputStreamWriter;\nimport java.io.PrintWriter;\nimport java.io.StreamTokenizer;\nimport java.util.*;\npublic class Main {\n	static int n;\n	static int m;\n	static int[][] markarray= new int[505][505];;\n	static int[][] dir4 ={{-1,0},{1,0},{0,-1},{0,1}};\n	static Queue<node> que = new LinkedList<node>();\n	static void dp(){\n		while(que.size()>0)\n		{\n			node t = que.remove();\n			for(int i = 0;i < 4;i ++)\n			{\n				int dx = t.x + dir4[i][0];\n				int dy = t.y + dir4[i][1];\n				if(dx < 0 || dy < 0 || dx > n-1 || dy > m-1 || markarray[dx][dy]>0) \n					continue;				\n				markarray[dx][dy] = t.step + 1;\n				que.add(new node(dx,dy,markarray[dx][dy]));\n			}\n		}\n	}\n	public static void main(String args[]) throws IOException {\n		 StreamTokenizer in = new StreamTokenizer(new BufferedReader(new InputStreamReader(System.in)));\n	        PrintWriter out = new PrintWriter(new OutputStreamWriter(System.out));\n	    in.nextToken();\n	    n=(int) in.nval;\n		in.nextToken();\n	    m=(int) in.nval;\n	    for(int i=0;i<n;i++){\n	        for(int j=0;j<m;j++)\n	        {\n	        	if(in.nextToken() == StreamTokenizer.TT_EOF) \n	        		break;\n	            int tmp=(int)in.nval;\n	           \n	            if(tmp==1){\n	            	que.add(new node(i,j,0));\n	            	markarray[i][j]=2000;\n	            }\n	        }\n	    }\n        dp();\n	       for(int i=0;i<n;i++){\n	        for(int j=0;j<m;j++)\n	        {\n	        	if(markarray[i][j]!=2000) {\n	        		out.print(markarray[i][j]);\n	        	}else {\n	        		out.print(0);\n	        	}\n	         if(j!=m-1)\n	        	 out.print(\" \");\n	        }\n	        out.print(\"\\n\");\n	    }\n	       out.flush();\n	}\n}\nclass node{\n	int x;\n	int y;\n	int step;\n	public node(int x, int y, int step) {\n		this.x = x;\n		this.y = y;\n		this.step = step;\n	}\n}');
INSERT INTO `eoj_submissions` VALUES ('1154', '1009', '1000', '3', '2019-04-30 18:50:30', '2019-04-30 22:42:50', '555', '18720', 'AC', '100', 'Compile Successfully.\n\n- Test Point #0: Accepted, Time = 295 ms, Memory = 14436 KB, Score = 50\n- Test Point #1: Accepted, Time = 260 ms, Memory = 18720 KB, Score = 50\n\nAccepted, Time = 555 ms, Memory = 18720 KB, Score = 100\n', 'import java.io.BufferedReader;\nimport java.io.IOException;\nimport java.io.InputStreamReader;\nimport java.io.OutputStreamWriter;\nimport java.io.PrintWriter;\nimport java.io.StreamTokenizer;\nimport java.util.Scanner;\n\npublic class Main {\n	public static void main(String[] args) throws IOException {\n		Scanner in = new Scanner(System.in);\n		long dp[];\n		long mod = 1000000009;\n		int a[] = new int[16];\n		a[1] = 1;\n		a[2] = 2;\n		for(int i = 3;i <= 15;i ++)\n			a[i] = a[i - 1] + a[i - 2];\n		int t, x;\n		t = in.nextInt();\n		while(t-->0)\n		{\n			dp = null;\n			dp = new long[3005];\n			dp[0] = 1;\n			x = in.nextInt();\n			for(int i = 1;i <= 15;i ++)\n			{\n				for(int j = a[i];j <= x;j ++)\n				{\n					dp[j] += dp[j - a[i]];\n					dp[j] %= mod;\n				}\n			}\n			System.out.println(dp[x] % mod);\n		}\n		\n	}\n}\n');
INSERT INTO `eoj_submissions` VALUES ('1155', '1009', '1000', '3', '2019-04-30 22:45:11', '2019-04-30 22:45:14', '480', '19396', 'AC', '100', 'Compile Successfully.\n\n- Test Point #0: Accepted, Time = 235 ms, Memory = 19396 KB, Score = 50\n- Test Point #1: Accepted, Time = 245 ms, Memory = 19360 KB, Score = 50\n\nAccepted, Time = 480 ms, Memory = 19396 KB, Score = 100\n', 'import java.io.BufferedReader;\nimport java.io.IOException;\nimport java.io.InputStreamReader;\nimport java.io.OutputStreamWriter;\nimport java.io.PrintWriter;\nimport java.io.StreamTokenizer;\nimport java.util.Scanner;\n\npublic class Main {\n	public static void main(String[] args) throws IOException {\n		Scanner in = new Scanner(System.in);\n		long dp[];\n		long mod = 1000000009;\n		int a[] = new int[16];\n		a[1] = 1;\n		a[2] = 2;\n		for(int i = 3;i <= 15;i ++)\n			a[i] = a[i - 1] + a[i - 2];\n		int t, x;\n		t = in.nextInt();\n		while(t-->0)\n		{\n			dp = null;\n			dp = new long[3005];\n			dp[0] = 1;\n			x = in.nextInt();\n			for(int i = 1;i <= 15;i ++)\n			{\n				for(int j = a[i];j <= x;j ++)\n				{\n					dp[j] += dp[j - a[i]];\n					dp[j] %= mod;\n				}\n			}\n			System.out.println(dp[x] % mod);\n		}\n		\n	}\n}');
INSERT INTO `eoj_submissions` VALUES ('1156', '1010', '1000', '3', '2019-05-04 22:10:30', '2019-05-04 22:10:33', '464', '20532', 'AC', '100', 'Compile Successfully.\n\n- Test Point #0: Accepted, Time = 248 ms, Memory = 18808 KB, Score = 50\n- Test Point #1: Accepted, Time = 216 ms, Memory = 20532 KB, Score = 50\n\nAccepted, Time = 464 ms, Memory = 20532 KB, Score = 100\n', 'import java.math.BigInteger;\nimport java.io.*;\nimport java.util.*;\npublic class Main {\n    public static void main(String []args) {\n    Scanner cin=new Scanner(System.in);\n	while(cin.hasNext())\n	{\n		String str = cin.next();\n		int len = str.length();\n		BigInteger N,one,two;\n		N = new BigInteger(str);\n		one = new BigInteger(\"1\");	\n		two = new BigInteger(\"2\");\n		int low = (int) str.charAt(len-1);\n		if(low%2==1){\n		 System.out.println(N.subtract(one).divide(two));\n		}else{\n		  String str1 = N.divide(two).subtract(one).toString();\n		  len = str1.length();\n			low = (int) str1.charAt(len-1);\n			if(low%2==1){\n			 System.out.println(N.divide(two).subtract(one));\n			}else{\n			 System.out.println(N.divide(two).subtract(two));	\n			}\n		}\n     }\n	}\n}');
INSERT INTO `eoj_submissions` VALUES ('1157', '1011', '1000', '2', '2019-05-04 22:23:46', '2019-05-04 22:23:52', '588', '1224', 'AC', '100', 'Compile Successfully.\n\n- Test Point #0: Accepted, Time = 133 ms, Memory = 608 KB, Score = 25\n- Test Point #1: Accepted, Time = 135 ms, Memory = 116 KB, Score = 25\n- Test Point #2: Accepted, Time = 238 ms, Memory = 1224 KB, Score = 25\n- Test Point #3: Accepted, Time = 82 ms, Memory = 108 KB, Score = 25\n\nAccepted, Time = 588 ms, Memory = 1224 KB, Score = 100\n', '#include <iostream>\n#include <string.h>\n#include <stdio.h>\nusing namespace std;\n\nint arr[1000];\nint n = 0;\nint maxlen = 1;\nint len = 1;\nvoid func(int i){\n    if(len>maxlen)\n        maxlen =len;\n    for(int j = i + 1;j<=n;j++){\n        if(arr[j]> arr[i])\n        {\n            len++;\n            func(j);\n            len--;\n        }\n    }\n\n}\nint main()\n{\n    char ch;\n    int i = 1;\n    while(1){\n        scanf(\"%d%c\",&arr[i],&ch);\n        if(arr[i]==0)\n            break;\n        n++;i++;\n        if(ch == \'\\n\'){\n\n            for(int j = 1;j<=n-maxlen+1;j++){\n                func(j);\n            }\n            cout<<maxlen<<endl;\n            n = 0;\n            i = 1;\n            maxlen = 1;\n            len = 1;\n        }\n    }\n\n    return 0;\n}\n');
INSERT INTO `eoj_submissions` VALUES ('1158', '1012', '1000', '2', '2019-05-04 22:32:35', '2019-05-04 22:32:39', '288', '116', 'AC', '100', 'Compile Successfully.\n\n- Test Point #0: Accepted, Time = 100 ms, Memory = 108 KB, Score = 33\n- Test Point #1: Accepted, Time = 106 ms, Memory = 108 KB, Score = 33\n- Test Point #2: Accepted, Time = 82 ms, Memory = 116 KB, Score = 34\n\nAccepted, Time = 288 ms, Memory = 116 KB, Score = 100\n', '#include <iostream>\n#include <string.h>\n#include <cstdio>\nusing namespace std;\nint m,n; //m x n\nint len;\nint arr[100];\nbool func(){\n        for(int i = 1;i<len;i++){\n            if(arr[i]==0) continue;\n            arr[i+1]-=arr[i];\n            arr[i]-=arr[i];\n        }\n        if(arr[len] == 0)\n          return true;\n        else\n          return false;\n}\nint main()\n{\n    while(cin>>m>>n){\n        len = m * n;\n        if(m==0 || n==0)\n            break;\n        int ff=0;\n        for(int i = 1;i<=m;i++){\n            ff++;\n            for(int j=1;j<=n;j++){\n                if(ff%2==1){\n                    cin >> arr[(i-1)*n+j];\n                }else{\n                    cin >> arr[(i*n)+1-j];\n                }\n            }\n        }\n        if(func()){\n           puts(\"Yes\");\n        }else{\n           puts(\"No\");\n        }\n    }\n\n    return 0;\n}\n');
INSERT INTO `eoj_submissions` VALUES ('1159', '1013', '1000', '2', '2019-05-04 22:48:07', '2019-05-04 22:48:13', '235', '1212', 'AC', '100', 'Compile Successfully.\n\n- Test Point #0: Accepted, Time = 82 ms, Memory = 1212 KB, Score = 33\n- Test Point #1: Accepted, Time = 79 ms, Memory = 116 KB, Score = 33\n- Test Point #2: Accepted, Time = 74 ms, Memory = 108 KB, Score = 34\n\nAccepted, Time = 235 ms, Memory = 1212 KB, Score = 100\n', '#include <iostream>\n#include <stdio.h>\n#include <string.h>\nusing namespace std;\n// memset(bag,0,200010*sizeof(long));\nint main()\n{\n    int n;\n    char a[2][1000000];\n    int j,f,ff,lena;\n    gets(a[0]);\n    cin >> n;\n    f = 0;\n    lena = strlen(a[f]);\n    while(n--){\n        ff = (f+1)%2;\n        j = 0;\n        char ch;\n        ch = a[f][0];\n        int size = 1;\n        for(int i=1;i<lena;i++ )\n        {\n            if(a[f][i]!=ch ){\n                if(size>10){\n                    a[ff][j++] = (size/10) + 48;\n                    a[ff][j++] = (size%10) + 48;\n                }else{\n                    a[ff][j++] =size + 48;\n                }\n                    a[ff][j++] = ch;\n                ch = a[f][i];\n                size = 1;\n            }else{\n                size ++;\n            }\n        }\n        if(size > 0){\n             if(size>10){\n            a[ff][j++] = (size/10) + 48;\n            a[ff][j++] = (size%10) + 48;\n            }else{\n                a[ff][j++] =size + 48;\n            }\n            a[ff][j++] = ch;\n            size = 0;\n        }\n\n        lena = j;\n        f =(f+1)%2;\n    }\n    for(int k = 0; k< lena; k++)\n        cout << a[f][k];\n    return 0;\n}\n');
INSERT INTO `eoj_submissions` VALUES ('1160', '1014', '1000', '2', '2019-05-04 22:52:58', '2019-05-04 22:53:01', '162', '108', 'AC', '100', 'Compile Successfully.\n\n- Test Point #0: Accepted, Time = 78 ms, Memory = 108 KB, Score = 50\n- Test Point #1: Accepted, Time = 84 ms, Memory = 108 KB, Score = 50\n\nAccepted, Time = 162 ms, Memory = 108 KB, Score = 100\n', '#include <iostream>\n#include <stdio.h>\n#include <string.h>\nusing namespace std;\n\nint main()\n{\n    int v,n;\n    cin >> v>>n;\n    long bag[2][100005];\n    memset(bag,0,200010*sizeof(long));\n    long cook[27];\n    for(int i = 0;i<n;i++){\n       cin >> cook[i];\n    }\n    int f = 1;\n    for(int i = 0;i<n;i++){\n        for(int j = 1;j<=v;j++){\n            int ff = (f + 1)% 2;\n            bag[ff][j]=bag[f][j];\n            if(j>=cook[i]){\n                if(bag[f][j]<bag[f][j-cook[i]]+cook[i]){\n                    bag[ff][j]= bag[f][j-cook[i]]+cook[i];\n                }\n            }\n        }\n        f = (f + 1 )%2;\n    }\n        cout<<v-bag[f][v]<<endl;\n    return 0;\n}\n');
INSERT INTO `eoj_submissions` VALUES ('1161', '1015', '1000', '3', '2019-05-04 22:56:09', '2019-05-04 22:56:13', '673', '14084', 'AC', '100', 'Compile Successfully.\n\n- Test Point #0: Accepted, Time = 347 ms, Memory = 13428 KB, Score = 50\n- Test Point #1: Accepted, Time = 326 ms, Memory = 14084 KB, Score = 50\n\nAccepted, Time = 673 ms, Memory = 14084 KB, Score = 100\n', 'import java.io.*;\nimport java.lang.*;\nimport java.util.*;\nimport java.math.*;\n\npublic class Main {\n	static StreamTokenizer in = new StreamTokenizer(new BufferedReader(new InputStreamReader(System.in)));\n	static PrintWriter out = new PrintWriter(new OutputStreamWriter(System.out));\n\n	static int nextInt() throws IOException {\n		in.nextToken();\n		return (int) in.nval;\n	}\n\n	static double nextDouble() throws IOException {\n		in.nextToken();\n		return in.nval;\n	}\n\n	static long nextLong() throws IOException {\n		in.nextToken();\n		return (long) in.nval;\n	}\n\n	static String next() throws IOException {\n		in.nextToken();\n		return in.sval;\n	}\n\n	public static void main(String[] args) throws IOException {\n		int N;\n		Scanner in = new Scanner(System.in);\n		N = in.nextInt();\n		while (N > 0) {\n			N--;\n			Map<Character, Integer> mapL = new HashMap<Character, Integer>();\n			Map<Character, Integer> mapR = new HashMap<Character, Integer>();\n			String str = in.next();\n			mapL.put(str.charAt(0), 1);\n			mapR.put(str.charAt(str.length() - 1), 1);\n			str = in.next();\n			while (str.charAt(0) != \'0\') {\n				mapL.put(str.charAt(0), 1);\n				mapR.put(str.charAt(str.length() - 1), 1);\n				str = in.next();\n			}\n			Iterator iter = mapR.entrySet().iterator();\n			int sum = 0;\n			while (iter.hasNext()) {\n				Map.Entry entry = (Map.Entry) iter.next();\n				char key = (char) entry.getKey();\n				if(mapL.get(key)==null)\n					sum++;\n			}\n			System.out.println(sum);\n		}\n	}\n}');
INSERT INTO `eoj_submissions` VALUES ('1162', '1016', '1000', '3', '2019-05-04 23:03:56', '2019-05-04 23:12:06', '758', '13540', 'AC', '100', 'Compile Successfully.\n\n- Test Point #0: Accepted, Time = 373 ms, Memory = 13260 KB, Score = 50\n- Test Point #1: Accepted, Time = 385 ms, Memory = 13540 KB, Score = 50\n\nAccepted, Time = 758 ms, Memory = 13540 KB, Score = 100\n', 'import java.util.Scanner;\r\n\r\npublic class Main{\r\n	public static void main(String[] args) {\r\n		 long  n;\r\n		 long count = 1;\r\n		 long tmp =2;\r\n		 Scanner in = new Scanner(System.in);\r\n		 n = in.nextLong();\r\n		    while(n>=1){\r\n		        if( (n & 1)==1){\r\n		         count = (count * tmp)% 20180520;\r\n		        }\r\n		        tmp =(tmp*tmp)% 20180520;\r\n		        n >>=1;\r\n		   }\r\n		   System.out.println(count);\r\n		   in.close();\r\n		   \r\n	}\r\n}');
